/* nexusilex_destroy is for both reentrant and non-reentrant scanners. */
int nexusilex_destroy  (void)
{
    
    /* Pop the buffer stack, destroying each element. */
	while(YY_CURRENT_BUFFER){
		nexusi_delete_buffer(YY_CURRENT_BUFFER  );
		YY_CURRENT_BUFFER_LVALUE = NULL;
		nexusipop_buffer_state();
	}

	/* Destroy the stack itself. */
	nexusifree((yy_buffer_stack) );
	(yy_buffer_stack) = NULL;

    /* Destroy the start condition stack. */
        nexusifree((yy_start_stack)  );
        (yy_start_stack) = NULL;

    nexusifree ( (yy_state_buf) );
    (yy_state_buf)  = NULL;

    /* Reset the globals. This is important in a non-reentrant scanner so the next time
     * nexusilex() is called, initialization will occur. */
    yy_init_globals( );

    return 0;
}

